import Post from "../post/Post";
import "./posts.css";

export default function Posts({ posts }) {
  Post.prototype.reduceRight();

  return (


    <div className="posts">
      {posts.map((p) => (
        <Post post={p} />
      ))}
    </div>
  );
}
